import React, { Component } from "react";
import classes from "./table.module.css";
import axios from "../../axios-data";
import Content from "../table/content/content";

class Table extends Component {
  state = {
    data: null,
    show: false,
  };
  componentDidMount() {
    console.log("conponet did mount");
    axios
      .get("/data.json")
      .then((res) => {
        const d = Object.values(res.data).map((ele) => {
          const d1 = Object.values(ele);
          return d1;
        });
        this.setState({ data: d, show: true });
      })
      .catch((err) => console.log(err));
  }
  render() {
    let data = null;
    if (this.state.show) {
      const d1 = this.state.data;
      data = d1.map((ele) => <Content key={ele.title} val={ele} />);
    }
    return <div className={classes.main_body}>{data}</div>;
  }
}

export default Table;
